          <>
            Flexible <HighlightedText>Plans</HighlightedText>
          </>
        }
      /> */}
      {/* <FAQ
        heading={<>Any <HighlightedText>Questions ?</HighlightedText></>}
      />
      <Blog
        subheading="Blog"
        heading={<>We love <HighlightedText>Writing</HighlightedText></>}
      />
      <GetStarted/> */}
    </AnimationRevealPage>
  );
};
